import Header from '../Components/Header/Header';
import Footer from '../Components/Footer/Footer';
import Button from 'react-bootstrap/Button';
import './Homepage.css';

import { BrowserRouter as Router, Route ,Link} from 'react-router-dom';

const HomePage = () => {

const deneme = () => {
    console.log("tıklama başarılı");
}

return (
  
    <React.Fragment>  
   <Header/>
   <Router> 
    <div className = "box">
      <div  class="d-inline-block "> 
      {/* <Link to ="/series"> <Button  className = "button" style ={{backgroundColor:'black'}}  onClick={deneme}>  SERIES</Button> </Link> */}
     <Link to="/series"> <Button  className = "button" style ={{backgroundColor:'black'}}  onClick={deneme}>  SERIES</Button> </Link>
      <p> Ppopular Series  </p>
      </div>
       <div  class="d-inline-block ">  
        <Button  className = "button"  style ={{backgroundColor:'black'}} onClick={deneme}>MOVIES</Button> 
        <p> Popular Movies</p>
        </div>
        </div>
        </Router>
      <Footer/>
        </React.Fragment>
        
);

}

export default HomePage;
